SELECT ?portName
WHERE {
    ?port a ns2:Port ;
          ns2:hasLatitude ?latitude .
    FILTER NOT EXISTS { ?port ns2:hasLatitude ?latitude2 .
                        FILTER(?latitude2 > ?latitude)
                      }
    ?port ns1:hasPortName ?portName .
}
