SELECT ?portName
WHERE {
  ?port a ns1:Port ;
        ns1:hasLatitude ?latitude ;
        ns1:hasLongitude ?longitude ;
        ns1:hasPortName ?portName .
  FILTER NOT EXISTS {
    ?port ns1:hasLatitude ?lat .
    FILTER(?lat > ?latitude)
  }
}
