```sparql
SELECT ?portName
WHERE {
  ?port a ns1:Port .
  ?port ns1:hasLatitude ?lat .
  ?port ns1:hasLongitude ?long .
  ?port ns1:hasPortName ?portName .
  FILTER (?lat = (
    SELECT MAX(?latitude) 
    WHERE {
      ?p a ns1:Port ;
         ns1:hasLatitude ?latitude .
    }
  ))
}
```

